import React, { PureComponent } from 'react'
import FormApp from './Form'
import { connect } from 'react-redux'

class Form extends PureComponent {
    constructor(){
        super() 
    }

    render () {
        return(
            <FormApp
            text={this.text}
            />
        )
    }
}

const mapStateToProps = (state) => {
    return {
        text: state
    }
}


export default connect(mapStateToProps)(Form)
